import React from "react";
import blogData from "../blog.json";

const BlogCards = () => {
  return (
    <div>
      {blogData.map((item) => (
        <div>
            <div className="image-div" style={{"backgroundImage": `../images/${item.image}`}}></div>
          <h1>{item.title}</h1>
          <p>{item.text}</p>
        </div>
      ))}
    </div>
  );
};

export default BlogCards;
